import React from 'react';
import './App.css';
import Home from './pages/Home'
import Houses from './pages/Houses'
import SigngleHouse from './pages/SigngleHouse'
import Error from './pages/Error'
import SingleHouse from './pages/SingleHouse';


function App() {
  return <>
    <Home />
    <Houses />
    <SingleHouse />
    <Error />
  </>;
}

export default App;
